import React, {Component} from "react";
import Styles from "./Styles.css";

class Next extends Component {
    render() {
        return (
            <div className={Styles.PreviousNextContainer}>
                <p>next photo : {this.props.mediaData.next} </p>
                <p>previous photo : {this.props.mediaData.next}</p>
                <p></p>
            </div>
        )
    }
}

export default Next;
